section.article:
(2) Ved innførsel av varer med luftfartøy skal minimumsdatasettet som er fastsatt i § 2-1-1 annet ledd gis så snart som mulig og senest før varene lastes om bord i luftfartøyet. I tilfeller hvor det ikke er gitt et minimumsdatasett eller minimumsdatasettet ikke anses som fullstendig forhåndsvarsel skal fullstendig forhåndsvarsel gis i henhold til § 2-1-1 første ledd, så snart som mulig og innen følgende frister:
for flyginger på over 4 timer – minst 4 timer før ankomst til første lufthavn i tollområdet,
for flyginger på under 4 timer – senest ved avgang i utlandet.
